import styled from 'styled-components';

export const Button = styled.Button`
  color: red;
  background-color: blue;
`;

export const Div2 = styled.div`
  width: 100%;
  height: 20rem;
  background-color: red;
`;

export const Div = () => {
  return (
    <Div2>
      <h1>Testetesteteste</h1>
    </Div2>
  );
};
